import './App.css';
import React from "react";
function App() {
  return (
    <div className="App">
     <div className='wrapper'>
       <input type="text" placeholder='Enter something'/>
       <button className='enter'>ENTER</button>
     </div>
    </div>
  );
}

export default App;
